import React from "react";
import { Link, Outlet } from "react-router-dom";


export function Root() {
    return (
        <>
        <ul>
            <li>
                <Link to="/">ホーム</Link>
            </li>
            <li>
                <Link to="/threads">スレッドを作成</Link>
            </li>
        </ul>
        <Outlet />
        </>
    )
}

export default Root;
